export const orderDetails = JSON.parse(order, function (field, value) {
  var dupValue = value;
  if (typeof value === "string" && /^(\d{4}\-\d\d\-\d\d([tT][\d:\.]*){1})([zZ]|([+\-])(\d\d):?(\d\d))?$/.test(value)) {
    var arr = dupValue.split(/[^0-9]/);
    value = new Date(
      parseInt(arr[0], 10),
      parseInt(arr[1], 10) - 1,
      parseInt(arr[2], 10),
      parseInt(arr[3], 10),
      parseInt(arr[4], 10),
      parseInt(arr[5], 10)
    );
  }
  return value;
});

